import { useState, useEffect } from 'react';
import '../stylesheets/App.css';
import { Outlet } from 'react-router-dom';


function App() {
  const [user, setUser] = useState(null)

  useEffect(() => {
    fetch('/authorized')
    .then((r) => {
      if (r.ok) {
        r.json().then((user) => setUser(user))
      } e
    })
  }, [])


  return (
    <div className="App">
      <Outlet context={setUser}/>
    </div>
  );

}

export default App;
